import React from "react";

function OrderConfirmationPage({cartItems, onOrder}){
    return (
        <div className="order-confirmation-page">
            <h1>Confirm Order</h1>
            <h2>Items in Cart:</h2>
            <div className="order-item-list">
                <ul>
                    {cartItems.map(item => 
                        <li key={item.id} className="order-item">{item.name}</li>
                    )}
                </ul>
            </div>
        </div>
    )
}

export default OrderConfirmationPage
